import React, {Fragment} from 'react';
import { Link } from 'react-router-dom';
import Img_Croix from './img/croix.png' 
import Burger from './img/burger.png' 
import logo from './img/logo.png'
import flag_fr from './img/flag_fr.jpg'
import Menu_open from './Menu_open'

function Menu_fermee(){

    // function Menu_visible(){
    //     (1 == 2 ) ? burger = document.getElementById('rien').style.display = "none" : burger = document.getElementById('rien').style.display = "inline"
    // }

    return(
        <Fragment>
            <div className="menu_fermee">
                <img className="imgBurger" onClick={() => document.getElementById('menuopen').style.marginLeft = "-500px" } src={Burger}/>
                <img className="logo" src={logo} />
                <img className="flag" src={flag_fr} />
            </div>
        </Fragment>
    )
}

export default Menu_fermee
